import React from 'react';

const privacy = () => {
    return (
        <div >
            <div style={{textAlign:'center'}}><h2>Privacy Policy</h2></div>
            <div style={{marginLeft:'5%',marginRight:'5%'}}>
                <br/>

                <div>
                Effective date: June 10, 2020
                <br/><br/>
                waulto's Blog ("us", "we", or "our") operates the https://waulto.com website (the "Service").

                This page informs you of our policies regarding the collection, use, and disclosure of personal data when you use our Service and the choices you have associated with that data.
                </div>
                <br/>
                <div>
                <p>We use your data to provide and improve the Service. By using the Service, you agree to the collection and use of information in accordance with this policy. Unless otherwise defined in this Privacy Policy, terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, accessible from</p>
                <a href="https://google.com">https://waulto.com</a>
                </div>
            </div>
        </div>
    );
};

export default privacy;
